import * as services from "../services/envanterServices";

import { useState, useEffect } from "react";

export default function ZimmetPage() {
  const [zimmetList, setZimmetList] = useState();

  useEffect(() => {
    if (!zimmetList) {
      services.getZimmet().then((res) => {
        setZimmetList(res.data);
        console.log(res);
      });
    }
  }, [zimmetList]);

  return (
    <table>
      <tr>
        <th>Zimmet Id</th>
        <th>Statu</th>
        <th>Personel SicilNo</th>
        <th>Personel Adı</th>
        <th>Personel Soyadı</th>
        <th>Personel Birimi</th>
        <th>Personel Görevi</th>
        <th>Envanter Tipi</th>
        <th>Envanter Markasi</th>
        <th>Envanter Modeli</th>
      </tr>

      {zimmetList?.map((item) => (
        <tr>
          <td>{item?.zimmetId}</td>
          <td>{item?.statu}</td>
          <td>{item?.personelSicilNo}</td>
          <td>{item?.personelName}</td>
          <td>{item?.personelSurname}</td>
          <td>{item?.personelBirimi}</td>
          <td>{item?.personelGorevi}</td>
          <td>{item?.envanterTipAdi}</td>
          <td>{item?.envanterMarkasi}</td>
          <td>{item?.envanterModel}</td>
        </tr>
      ))}
    </table>
  );
}
